import React from 'react'
import './Card.css';

const title="Todo App"
const date = new Date();
const getDate = date.getDate();
const getMonth = date.getMonth();
const getYear = date.getFullYear();
const description = "Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolores alias ut veniam?"

function Card() {
  return (
    <div className="container">
    <div className="cards">
      <div className="card card-one">
        <h2 className="card-title">{ title }</h2>
        <p className="date">{getDate +"/"+ getMonth +"/"+ getYear}</p>
        <p className="description">{}</p>
      </div>
    </div>
  </div>
  )
}

export default Card
